import React from 'react';
import banner from '../assets/images/Banner1.png';
import Card from '../components/Card/Card'; // Importez le composant Card
import './Home.css'
import '../components/Banner/Banner.css'

const Home = () => {
  const cardData = [
    { title: 'Card 1', description: 'Titre de la location', imageUrl: 'https://via.placeholder.com/150' },
    { title: 'Card 2', description: 'Titre de la location', imageUrl: 'https://via.placeholder.com/150' },
    { title: 'Card 3', description: 'Titre de la location', imageUrl: 'https://via.placeholder.com/150' },
    { title: 'Card 4', description: 'Titre de la location', imageUrl: 'https://via.placeholder.com/150' },
    { title: 'Card 5', description: 'Titre de la location', imageUrl: 'https://via.placeholder.com/150' },
    { title: 'Card 6', description: 'Titre de la location', imageUrl: 'https://via.placeholder.com/150' },
  ];

  
  return (
    <div className="home">
      <Header /> {/* Utilisation du composant Header */}
      <div className="home-banner">
        <img src={banner} alt="Kasa banner" className="home-banner-img" />
      </div>
      <div className="home-content">
        <div className="cards-container">
          {cardData.map((card, index) => (
            <Card 
              key={index} 
              title={card.title} 
              description={card.description} 
              imageUrl={card.imageUrl} 
            />
          ))}
        </div>
      </div>
    </div>
  );
};

export default Home;
